import { Container } from 'react-bootstrap';

class Detail extends Component {
    render(){
        return(
            <Container className="mt-4">
                <p style={{fontSize: '10px'}}>Kategori / Komik / Naruto</p>
            </Container>
        )
    }
}

export default Detail;
